    Financial Services Departments financial transparency application.  Austin Finance
    Online (AFO) provides citizens, media, City staff, and other interested parties
    with one easily accessible financial data source.  AFO not only provides what you
    would expect from a financial portal - Budget Documents, CAFRs, Official Statements
    and contact links for offices that comprise the Financial Services Department -
    but also serves as a switchboard to give users direct access to specialized capabilities.
